import React from 'react';
import './ListItem.css';

const ListItem = ({
    image,
    name,
    description,
    twitterlink
}) => (
    <li className="ListItem__wrapper">
        <img 
            className='ListItem__img'
            src={image}
            alt={name}      
        />
        <div>
            <h2 className='ListItem__name'>
                {name}
            </h2>
            <p className='ListItem__name'>
                {description}
            </p>
            <a 
                target='_blank'
                href={twitterlink}
                className='ListItem__button'
            >Hello someone</a>
        </div>
    </li>
);

export default ListItem;
